	/**
	 * Sliding Window 时间复杂度：O(2n)=O(n)
	 * 
	 * @param s
	 * @return
	 */
	public static int leetcodeLengthOfLongestSubstring1(String s) {
		int n = s.length();
		Set<Character> set = new HashSet<>();
		int ans = 0, i = 0, j = 0;
		while (i < n && j < n) {
			// try to extend the range [i, j]
			if (!set.contains(s.charAt(j))) {
				set.add(s.charAt(j++));
				ans = Math.max(ans, j - i);
			} else {
				set.remove(s.charAt(i++));
			}
		}
		return ans;
	}

	public int leetcodeLengthOfLongestSubstring2(String s) {
		int n = s.length(), ans = 0;
		Map<Character, Integer> map = new HashMap<>(); // current index of
														// character
		// try to extend the range [i, j]
		for (int j = 0, i = 0; j < n; j++) {
			if (map.containsKey(s.charAt(j))) {
				i = Math.max(map.get(s.charAt(j)), i);
			}
			ans = Math.max(ans, j - i + 1);
			map.put(s.charAt(j), j + 1);
		}
		return ans;
	}

	/**
	 * 时间复杂度：O(2n)=O(n)
	 * 
	 * @param s
	 * @return
	 */
	public static int myLengthOfLongestSubString2(String s) {
		if (s.equals("")) {
			return 0;
		}
		int length = s.length();
		int i = 0, j = 0;
		int result = j - i + 1;
		while (i < length && j < length) {
			if (isHaveRepeatChars(s.substring(i, j), s.charAt(j))) {// 00
				i++;
			} else {
				result = (result > j - i + 1) ? result : j - i + 1;
				j++;
			}

		}
		return result;
	}

	private static boolean isHaveRepeatChars(String str, char ch) {
		return str.contains(String.valueOf(ch));
	}

	/**
	 * Brute Force 时间复杂度：O(n*n*n),速度太慢
	 * 
	 * @param s
	 * @return
	 */
	public static int myLengthOfLongestSubstring(String s) {
		if (s.equals("")) {
			return 0;
		}
		Map<Integer, String> map = new HashMap<>();
		int start = 0;
		int end = 0;
		int result = 1;
		for (int i = 0; i < s.length(); i++) {
			for (int j = i + 1; j < s.length(); j++) {
				start = i;
				end = j;
				if (isHasRepeateChars(s.substring(i, j + 1))) {
					continue;
				} else {
					result = (j - i + 1) > result ? (j - i + 1) : result;
					// System.out.println("1 : "+s.charAt(i));
					// System.out.println("2 : "+s.charAt(j));
				}
			}
		}
		return result;
	}

	private static boolean isHasRepeateChars(String substring) {
		Map<Character, Integer> map = new HashMap<>();
		for (int i = 0; i < substring.length(); i++) {
			if (!map.containsKey(substring.charAt(i))) {
				map.put(substring.charAt(i), i);
			} else {
				return true;
			}
		}
		return false;
	}
